INSERT INTO `ss_image` (`hash`, `acno`, `kind_id`, `collection_id`, `copyright_class_id`, `copyright_holder_id`, `format_id`, `location_id`, `news_restriction_id`, `personality_id`, `origin_date`, `photographer_id`, `subject_id`, `width`, `height`, `seq`, `annotation`, `headline`) VALUES ('26f403ad9ed5c9780f4c1e684d27f0e2ab53f5d2',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-20',1339,NULL,600,896,0.877885140319453,'<p>Dave relaxes in Thrunton Woods while I faff around with a camera. Unusually Dave doesn\'t have a cigarette in his hand. There\'s a plaque on that bench commemorating the life of some poor chap who died of a heart attack on the climb up to it. He was on a bike. It\'s poignant of course, but also grimly humorous.</p>','Dave Relaxes'),('3893d8515625365ac98f0ed0bb380b61d3d974a3',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-27',1339,NULL,600,896,0.31706938342856,'<p>Steve loads the bikes on to the car. Doesn\'t the car just look great covered with bikes? I reckon I could get five on the roof and three on the back at a push.</p>\r\n\r\n<p>The bikes are: Steve\'s Schwinn Homegrown on the back, then on the roof from the right Rosie\'s Cannondale, my Marin Mount Vision and Pace RC200 singlespeed.</p>','Lake District Trip'),('c2c8249902fc53c3af53935a68e77332ae35dd1d',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-21',1339,NULL,600,896,0.173573914953646,'<p>Dave\'s bike gets a lift up onto Long Crag. We generally try to avoid having to carry our bikes, but sometimes they just insist of having a rest. He always manages to crack a smile though doesn\'t he?</p>','Long Crag, Thrunton'),('48bdfbd8ac4f07137074099c62da37026d605cff',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-21',1339,NULL,896,600,0.0537229779610655,'<p>Dave surveys the view from the top of Long Crag. Again, no cigarette. Great view though eh? I must use that \'placing a rider in the foreground for scale\' cliche more often...</p>','Long Crag, Thrunton'),('9d3a9c7539232b67543b16c28e56cb580b1e5b03',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-18',1339,NULL,896,600,0.0412406541727108,'<p>The riders mill around outside Hebden Bridge station waiting for someone to tell them they have to start riding again. At this stage we\'re trying to work out whether we\'re the slow group or the fast group.</p>','Singletrack Magazine Ride'),('d2c2491b902cc3b8ee52a21a79414d66bc087b4b',6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-31',1339,NULL,600,896,0.439128785996527,'<p>You\'d think with all the scenery I could take a more interesting picture wouldn\'t you? It\'s not as if you haven\'t already seen a bike. Actually I was feeling really crap that day. When I stopped I slumped at the base of a wall and started sucking manically on my Camelback. From that low vantage point my bike was the most interesting thing to photograph.</p>','Lake District Trip'),('c3e2231dba881e131bd0b6f15fc14712620b695f',7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-01',1339,NULL,896,600,0.0912762387134407,'<p>More bike porn, this time the Pace. See that front tyre? Guess how much lateral grip it gets with that tread pattern. Yup, that\'s right. None at all.</p>\r\n\r\n<p>The Pace has gone to a new home now, but then it wasn\'t new when I got it. I think it\'s just one of those itinerant bikes that will go from owner to owner for its whole life. Don\'t get me wrong; I loved it and everything, but it fell for someone else and that was that.</p>','Pace RC200 Singlespeed'),('aa998e9bec2aa8b7dc8db54cd97226d883381074',8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-14',1339,NULL,600,896,0.0645630715793324,'<p>This is the wood just to the North of Ewartly Shank. That\'ll be Rory and Dave sharing a cigarette. Have you seen what Rory\'s wearing? He\'s like a one man museum of mountain bike togs. You can see the trail we\'ve just come down above and behind Steve.</p>','Ewartly Shank'),('5342a74cdf70417b568f3b6b48f8479e203f3ee6',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-07',1339,NULL,600,896,0.459259588097439,'<p>Dave approaches some nice stone slabs on the top of Simonside. I\'d just wimped these because I\'d already hurt my knee as per the next picture. I really was riding unusually ineptly that day, even by my standards. Actually I wish I was there now just so I could have a go at doing it properly.</p>','Simonside Rocks'),('da6f802039746e88004f3167df7dab975f063a4e',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-10-07',1339,NULL,600,896,0.837911362543121,'<p>OK, it doesn\'t look like much but it really hurt. More distressingly I wasn\'t doing anything particularly spectacular when it happened. I just put my foot down on the wrong side, when I probably didn\'t need to put my foot down at all. Cursed incompetence.</p>','Bloody Knee'),('5c37d4b16e2ff5f8e684ccf5ebb2125cd6dacfeb',11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-18',1339,NULL,896,600,0.487347019593905,'<p>This is us getting our shit together outside the Singletrack offices. Soon after this picture 53 of us set off for the local hills.</p>','Singletrack Magazine Ride'),('1ba98cfef8a6cdc15c0c0ee02db7f70446aa3433',12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-18',1339,NULL,600,896,0.296628857527129,'<p>This is the first climb of the day. I didn\'t really want to take a picture, but I did want a break from the exertion. I hopped off the bike and immediately grabbed my camera and started clicking away so that folks would be convinced that I still had plenty of energy but had been overwhelmed by a creative urge. Sneaky huh? I bet you\'ve never done that.</p>','Singletrack Magazine Ride'),('f36da796d2d7d5af1628a212f5c4c875da31206a',13,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-27',1339,NULL,896,600,0.556028131244389,'','Self Portrait'),('93876c606468d821475cbd543718c552d90cebd6',14,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-18',1339,NULL,896,600,0.875019835656559,'<p>We stopped on the hill above Todmorden to regroup. Tod can just be seen in the lower right of the picture.</p>','Singletrack Magazine Ride'),('e831b3db66c1355a332e2009a6b59137731d269b',15,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-15',1339,NULL,600,896,0.549267130967973,'','Gate'),('bf3d4f1c4975bcb34a37b2070b5ebc2d997dfa26',16,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-15',1339,NULL,896,600,0.937651058819231,'<p>I haven\'t ridden along this bit of railway line for a while, so I was quite surprised to find this pile of rubbish. On the one hand it\'s a real pisser that people think it\'s acceptable to chuck their crap off a bridge in the middle of the country (or anywhere for that matter). On the other hand it does look quite amusing. I think the armchair lends the whole tableau a certain pythonesque quality.</p>','A Pile of Rubbish'),('bd9f005cbc6c31d27194fc10e98a78b91deb666f',17,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-27',1339,NULL,896,600,0.800226487741668,'<p>Another scary self portrait. Nice sky though. Couldn\'t do that again if I tried.</p>','Self Portrait'),('1505c9ce192604e7410979d1c6754c3610addc86',18,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-31',1339,NULL,896,600,0.244532514458211,'<p>This is Simon approaching the cairn that looks out over Rothbury. He\'s not wearing a helmet because he\'s a very naughty boy. Still, everything was so soft and fluffy that day that it\'d be like falling into a tub of candyfloss. With rocks in it.</p>','New Year\'s Eve'),('ce71c6d1b30ea6a19460cf2bca4d72651f6d1c3f',19,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-31',1339,NULL,896,600,0.646195361526715,'<p>No tyre tracks. Yet.</p>','New Year\'s Eve'),('adefdf4aa7888539ea7fe02e64585cf3395ff32a',20,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-31',1339,NULL,896,600,0.507193675650161,'<p>What a great way to see out the old year. Simon and I took a short spin round the Carriage Drive at Cragside. It\'s not very long; about five miles from where we start at Cragside to Rothbury town centre, so we normally use it as part of a larger loop, but this particular day it was so beautiful that we decided to do it in reverse as soon as we\'d done it the right way round.</p>','New Year\'s Eve'),('0f70526326ea88780cf21736a59a24e670d7902c',21,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-01-20',1339,NULL,896,600,0.828864897281463,'<p>I love my Continental Vertical Pros very nearly as much as they like mud. Really, they\'re great on everything else. Well, everything I\'ve tried them on; wet rock, sand, roots, slippery grass but mud just sticks to them like it would to a blanket.</p>','Mud Bike'),('89fcfa7568cd08d27b8e1ddee256da8045e2532e',22,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-17',1339,NULL,896,600,0.12615727673602,'<p>It may look as if I\'ve Photoshopped Jon Wyatt in to this shot, but he was really there with his imaginary video camera. In fact it looks as if I made it from about five different photos; nobody\'s looking at anyone else. It\'s all real though, for what it\'s worth.</p>','Singletrack Ride, Todmorden'),('fa4244174e85a404666aef779b9c535c558d9412',26,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-17',1339,NULL,896,600,0.329122464391894,'<p>Here we all are enjoying a well earned ice cream. That\'s the pink Serotta in the foreground to the left. I\'m not quite sure why Dave Anderson looks so camp, but I suspect it has something to do with Shaun\'s skin tight Singletrack jersey.</p>','Singletrack Ride, Todmorden'),('a65ad82f749c15f2bfec36d9c93f93fd810eecd3',28,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-25',1339,NULL,899,600,0.567854566969462,'<p>Here\'s a side view of the Bred Tin. The seat was a bit high when I took it; this is before I\'d actually tried riding it.</p>','Bred Tin'),('ad2bac130319923cb4ce8417c0a9f62437682826',29,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-09',1339,NULL,800,650,0.964629398803112,'<p>Look: I\'ve managed to take quite possibly the least spectacular trail shot you can get at Glentress. I had to keep the angle really tight to crop out all the berms, switchbacks, jumps and sinuous singletrack which would have otherwise cluttered the image.</p>','Snow at Dracfest'),('9a9e44c60a1ec45036fee16edb2ae6cad936fd9e',30,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-24',1339,NULL,600,785,0.333939494585831,'<p>On our way back from our <a href=\"/cgi-bin/redir.pl?http://www.singletrackworld.com/article.php?sid=464\" target=\"_blank\">assault on Snowdon</a> Chipps decided it was all too much for him and had a quick snooze. I was guzzling fistfulls of Pro Plus to avoid following him to the land of nod.</p>','Chipps Sleeps'),('fb026887ee679d627cfd45a4c87b11695d75f183',32,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-25',1339,NULL,600,851,0.0732689297029268,'<p>Here\'s the prototype Ti Inbred, just built, never ridden. I had the seat a bit high in the photo, but apart from that everything was just right including the huge front tyre which complements the rigid forks perfectly. Huge cheesy grin non pictured.</p>','Bred Tin'),('fdc6d5267435b7a2180482a3e514911be9890f51',33,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-12',1339,NULL,896,600,0.560725480982644,'<p>Steve\'s going to have a tough job getting 7\" of suspension travel out of this baby, but it evidently isn\'t going to stop him trying.</p>','Steve\'s new Bike'),('b627dca24b3a9a49e7ad79d0d0b6cf820d7ebfe7',34,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-01',1339,NULL,896,600,0.790969912367572,'<p>Once Piers gets the taste of a Tunnocks Caramel Brick Thing he just has to start taking stuff to bits. In this case he\'s about to change the pawls in his freewheel; something he seems to have to do about twenty times as often as an ordinary mortal would.</p>','Piers and his Pawls'),('5f99b692afab1325f32bf233c86340f1dd78350b',36,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-01',1339,NULL,896,600,0.586242810980334,'<p>How mad does Lee look here? Is he singing? Barking at the moon? That\'ll be Piers Barber and Jack Peterson in the foreground, Billy Davison to Lee\'s left and Ian Jones talking to the kid with the spikey barnet.</p>','Northumberfest Drunkards'),('a404d756ccb864e0a145e04b783ca6d1a236ff5d',37,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-24',1339,NULL,600,896,0.901112576844035,'<p>This is almost exactly the blurred image my brain was seeing as we drove back from Snowdon. At this stage I\'ve eaten most of the packet of Pro Plus which is nestling in the foreground.</p>','Pro Plus Powered'),('0816b55c73e7db9d4dc821eeb4a5bcf565cd59d0',38,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-13',1339,NULL,896,600,0.522624595671036,'<p>Aren\'t they sweet? They\'re on their way to Long Mynd for a brisk ride and a few beers. From the left Mike\'s, Steve\'s and mine. Betcha want one, doncha?</p>','Three Amigos'),('86e0475a9672b1c7289c212ffcc43d01a23edfe6',39,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-30',1339,NULL,896,600,0.50615882495174,'<p>I\'m useless at posing group shots. Can you tell?</p>','Hamsterfest Guys'),('4cf075b26e2dad64f0664e25c1ca05f0ee3c65c5',40,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-31',1339,NULL,896,600,0.899744151147768,'<p>Doesn\'t he look intrepid? What a great day for riding a bike that was.</p>','Simon in the Snow'),('1d0c7fe8a52bd16797674150c179a016ba923be5',41,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-02',1339,NULL,896,600,0.0736998921143837,'<p>This is the first time we visited the Cheviot Hillriders downhill track and, as you can see, we\'re not quite sure what to expect. In the end we survived to tell the tale.</p>','Dave Prays'),('89a1a94a2e704a775a2c5165521623530e69c983',43,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-14',1339,NULL,600,896,0.38437112529472,'<p>After about five miles of riding on a split rear rim the inner tube blew out, so I got rid of the rubber at the back altogether. At this stage I still had another couple of rocky miles to go which I ended up riding on the rim. Remarkably when I got home the back wheel was still completely true; a tribute to the skill of Trigger who builds the On-One wheels. He can build a wheel in twelve minutes too...</p>','Stripped Reetard'),('9857c5b95f868a6898365631e416879252f46a80',44,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-02',1339,NULL,896,600,0.77553746607293,'<p>Look at the XC Jey Boy Jump! Actually Drac gets pretty jumpy all the time on that Rockhopper. Madness if you ask me, but he weighs nothing and he hasn\'t broken anything yet.</p>','Drac Jumps'),('17692f7f38d8a231a62677d4e55b19a5232cf9e7',45,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-30',1339,NULL,896,600,0.0625647690378557,'<p>The reason why an unusual number of the people here seem to be gurning is that I\'d just handed round the Fruit Pastilles; they don\'t normally pull faces like that, honest.</p>','Hamsterfest Gurning'),('9d00e4cc8c0eac2e56fb504b42d9bd58b7a20e7f',46,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-21',1341,NULL,910,600,0.87882758531163,'<p>We went to ride the excellent trails at Coed-y-Brenin, but by Sunday a gentle run along the Mawddach Trail was all we could manage. It turned out to be an absolutely idylic day as you can probably tell by the sickeningly happy looks on our faces. Thanks to Louise for the photo.</p>','Perfect Day'),('46d8d6348e3385d9d2d499c2c8a6cfe45552d0fd',47,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-24',1342,NULL,400,300,0.241861704447871,'<p>This was my second ride on the lovely Inbred. See how happy I look?</p>','Jockstock 2001'),('f2e4d9bfd89e8a70585f983bdd68aa1f6af73132',48,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-24',1342,NULL,400,262,0.854913925893083,'<p>With the exception of Chipps, who is behind the camera, this is the full Jockstock 2001 posse. The hut isn\'t with us.</p>','Jockstock 2001'),('005feb4462cbbbf619b83f544aafdacb3f09fc43',49,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-24',1339,NULL,904,600,0.699343849229201,'<p>Here we are collecting our thoughts in the carpark of the Green Tree. I think we\'d been faffing for a good hour at this point and there was more to come.</p>','Jockstock 2001'),('3f133d9e1f274be05c4fd1982963c6725b3a7829',50,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-11-24',1339,NULL,536,800,0.259249148016824,'<p>He\'s a blur either because he\'s moving so fast or because I was falling over backwards as I released the shutter. The latter I think.</p>','Chipps, Jockstock 2001'),('cb85e2633aef8caca807764552aee4f4ecb97c8d',51,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-14',1343,NULL,700,708,0.80833313906048,'<p>Here\'s Steve blasting up the last climb of the day at Long Mynd with me bringing up the rear (I\'m nestled in the crook of his left arm, which is nice)</p>','Steve Makin Rules the Climb'),('353d0a3f4edac803603caef6808c4f4ba7b1dc6c',52,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-25',1344,NULL,640,480,0.336996955599059,'<p>The Bred Tin, proud and rampant on a hill over Wooler; lord of all it surveys. Um. Nice ride too.</p>','Bred Tin on a Hill'),('89c467e390fec32815e10baaf41472f31512dba9',53,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-25',1344,NULL,640,480,0.751778353724397,'<p>The Bred Tin taking a rest on a hill outside Wooler. It was a big climb and the poor thing was exhausted.</p>','Bred Tin'),('335409bd3c043eecf106cffd979c2e1a5b350a18',54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-25',1344,NULL,640,480,0.0411135804314178,'<p>Michael was going to do this jump on his Klein. Fortunately a modicum of common sense prevailed and he borrowed this Orange instead. You wouldn\'t catch me doing that. Oh no.</p>','Michael Gets Air'),('2488343656943485f8b9ed825fff3cbd1313a0d8',55,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-05',1344,NULL,640,480,0.262050561786452,'<p>Nobody told Ben that XC bikes are supposed to stay firmly stuck to the ground, or at least within a few inches of it. He seems to have forgotten his helmet too.</p>','Bred Tin in Flight'),('a2d1185691570d4e5b7b05b68022cdd4aa2fec55',56,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-26',1339,NULL,672,546,0.423375402705535,'<p>Here\'s what happens if you overtighten a bolt in axle, particularly on forks with cast magnesium drop outs. A salutory tale for ham fisted mechanics everywhere.</p>','Oops'),('a6591c16d8f8f86b5f42c3afdae0c6c986e13242',58,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-26',1339,NULL,600,1015,0.841268201985013,'<p>This is the Inbred showing off its brand new third set of forks. Marzocchi Z2 X-Flys this time.</p>','Inbred With Z2s'),('444ee44d8c4171a19bd45d0fca0bf92c1ade265c',59,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-24',1342,NULL,600,900,0.479453091802192,'<p>This is the only time I\'ve worn that balaclava. It was lovely and warm, but having seen what a gimp it makes me look I\'ve tended to leave it on the shelf. Of course I haven\'t been anywhere as cold as that since, so it might reappear next winter.</p>','Gimp Mask on Snowdon'),('80a36356d6ab1b6b052b9ae00ed8bf03ad80ad96',60,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-01',1342,NULL,900,600,0.500851080681446,'<p>The pink wig distracted him from the fact that I was wearing nothing but socks on my feet.</p>','And Who Are You?'),('e48dce6c7fff098adade8b886e42b318609c68d6',61,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-01',1342,NULL,900,600,0.10828454570715,'<p>It\'s the catalogue party people!</p>','Northumberfest Party People'),('2e675897b9c54f5d806d27fe944da70e3fa97273',63,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2001-12-23',1339,NULL,896,600,0.701781049354789,'<p>Funny how pristine snow makes everything look a bit better, isn\'t it?</p>','Derwent Walk'),('c864714550db84df767f6decc03dc54715f3c9f6',64,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-01',1339,NULL,800,536,0.252442822849211,'<p>For some reason Rob and Steve both look as if they\'ve got their mouths full of something that\'s trying to get out. I guess they\'d both just taken a swig of beer but are trying to look sensible.</p>','The Usual Suspects'),('f42c5f6aa4ad7e5485637a614740c34cad886a05',67,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-01-20',1339,NULL,600,785,0.549599849831537,'<p>Hmmm. Someone seems to have smeared Vaseline on the lens for a complexion flattering soft focus effect. The mud splatters and grin are the point of the picture. Knackered but happy.</p>','Mud Freckles'),('a6d789ad50f6eca1cc06c81b204b3a7918ff24ed',68,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-02-24',1345,NULL,640,480,0.299841974588514,'<p>About two thirds of the way to the summit we sheltered under the railway bridge. Everyone\'s looking around as if they\'ve lost something on the ground; no idea what that\'s about.</p>','Sheltering on Snowdon'),('04bba685cf3a138d56c4cd9cc38002668155cf95',70,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-27',1339,NULL,896,600,0.532928389252625,'<p>This is Lee getting some air at the Cheviot Hillriders DH course. Dave looks on in a mixture of terror and awe. His turn next.</p>','Lee Jumps'),('c4387ec5f103993594810d601e0227d228e5c285',72,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-10',1339,NULL,600,784,0.514333953057061,'<p>If you\'re going to use a Thule Velo Vise rack with Hope disk brakes you\'ll either have to remove the front caliper every time you carry the bike or take a hacksaw to the rail and modify it like this. It looks drastic, but this bit of the rail is barely stressed and it beats taking the bike to bits every time.</p>','Thule Rack Modifications'),('09ec67fc6e98fa1206d6a9376b4addf43b0cae76',73,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1339,NULL,800,566,0.584592162300023,'<p>Isn\'t it cute? Exquisite actually. I\'d like one, but I think they\'re a few hundred quid.</p>','Ickle Bike'),('a7d1daac23ab84d4d4f4c8a6137f78a6298ef70d',75,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-27',1339,NULL,711,800,0.0263490971422797,'<p>Don\'t cross him...</p>','Geoffrey Day'),('2b03b0a721798d1d1ea9e6d7ada94d9cbe61ef8b',77,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1346,NULL,800,600,0.74228270918471,'<p>Have you seen the steering on that thing! As soon as you turn the bars it bends in the middle which throws the centre of gravity in the wrong direction for stable cornering. Scary, but strangely addictive.</p>','Cruiser at Bike 2002'),('883d83bc2dffac8a5c57d0c05aed684ad8610d0c',78,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1346,NULL,782,600,0.3429261069532,'<p>Here\'s Brant getting the hang of the outrageous steering properties of a cruiser at Bike 2002. Hope he doesn\'t get any geometry ideas from it.</p>','Brant with Phat Cruiser'),('e5eb3a3687cc5c6d95410fce9832bcb76a78e551',79,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1346,NULL,600,800,0.45581270047391,'<p>Mike Davis shows of his manly physique and profoundly heterosexual T shirt at Bike 2002.</p>','Mike Davis at Bike 2002'),('6b94a4a609cdd6b5de1ac865ebf3b5ad333cf433',80,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1339,NULL,600,830,0.597937759548337,'<p>Here\'s Singletrack magazine\'s Shaun Murray at Bike 2002. We\'ve had a few beers and I think he\'s about to say something quite profound.</p>','Shaun Murray'),('39872ddc15989d60643ad16a7d69a6350ffc7cc1',81,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1339,NULL,790,600,0.357568172785466,'<p>Here\'s Brant fondling the Bred Tin frame at Bike 2002. It rode on his lap all the way there and slept with him at the hotel. It must be love.</p>','Bred Tin Frame'),('ad1dde882dc85e164c8bc8adfabcbbedd377732e',82,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-03-23',1346,NULL,600,812,0.562791725864386,'<p>Here\'s me doing (well, trying to do) the Easy Rider thing at Bike 2002. Dennis Hopper and industrial quantity of drugs not shown.</p>','Phat Chopper'),('57c60478e9a0edb5201b8135f1339903f1c021dd',84,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-03',1339,NULL,893,600,0.95310165866044,'<p>Lee and Steve looking a little tired &amp; emotional at the Northumberfest Lite party. Lee is telling the story of the evening in mime.</p>','Northumberfest Lite Party People'),('4f801ad1ec261aa0c82b27a1a76394dfa490c12d',85,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-07',1347,NULL,600,885,0.256329695690845,'<p>I missed this ride. It was a couple of days after my birthday and I woke up feeling really rotten; delayed after effects of the party perhaps. By all accounts I missed a great day, and as soon as the guys left I started to perk up so I should have made the effort really.</p>','Lee on High Street'),('3ed46ec9b79cc4a1977b8529703cf0cdfff6573a',87,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-05-03',1339,NULL,896,600,0.918493427081618,'<p>Steve and Lee looking strangely vacant at the Northumberfest Lite apr&eacute;s pub party. Although no alcohol is visible there\'s lots inside them.</p>','Northumberfest Lite Party People'),('5a84685257316cb2950addf01e9b3c4ef80f5f02',88,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-04-14',1339,NULL,862,600,0.259039868620022,'<p>Mike, Steve and I turned up at Long Mynd with matching (roughly) Inbreds. Here they are doing a bit of pre-ride posing. From the left: Mike\'s, mine and Steve\'s.</p>','Three Amigos'),('8c27e607d6a29c56bd64860b503b02efd13096cb',89,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-01',1339,NULL,892,600,0.926150727027288,'<p>This is Th&eacute;r&egrave;se\'s geared Inbred. See <a href=\"/bikes/therese-inbred/index.jsp\">here</a> for more info. That\'s the market place in Alnwick in the background: scene of much Northumberfest mayhem...</p>','Geared Inbred'),('bd6b53644a2339463e96656c2a3f2b38d171c112',91,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-01',1339,NULL,600,896,0.652760863174315,'<p>Here\'s a clear view of the cable routing.</p>','Geared Inbred'),('d838361d3484a1488599ac90da6a417b10ddce29',93,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-01',1339,NULL,600,896,0.71833433874885,'<p>Unfortunately the front mech\'s band covers the DN6 label.</p>','Geared Inbred'),('258b3b09bf011cbcc8677d4e0c34511c1346a0a6',94,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-01',1339,NULL,600,896,0.833979912086576,'<p>The forks are Marzocchi MXCs with a coil conversion. No stickers because I managed to crack one of the dropouts and had to get a replacement leg casting.</p>','Geared Inbred'),('4adaaeb045b6a81d47619d76cc119e44dc7b89c2',103,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-23',1348,NULL,800,600,0.734339387478556,'<p>I remember this one. I made a special effort to look natural. Didn\'t work, did it?</p>\r\n\r\n<p>Picture from <a href=\"/cgi-bin/redir.pl?http://www.bikemagic.com/\" target=\"_blank\">BikeMagic.com</a>.</p>','Red Bull 2002'),('2de55f22fc9fa8b54c82836897172c3988c62f33',104,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-22',1348,NULL,800,600,0.740427601137579,'<p>That\'ll be me then. I\'m not sure why I\'m covering the back brake; I think that was a nearly flat bit. Still, better safe than sorry eh?</p>\r\n\r\n<p>Picture from <a href=\"/cgi-bin/redir.pl?http://www.bikemagic.com/\" target=\"_blank\">BikeMagic.com</a>.</p>','Red Bull 2002'),('983ba1ae10c850e51ffb36e548f0964c0bb7684d',105,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-22',1339,NULL,896,600,0.178859844132084,'<p>I woke up parched and hungover on Saturday morning and was relieved to find that I\'d been at least sober enough to bring my bike into the tent. Then I realised that the <a href=\"/inbred/titanium/index.jsp\">Titanium Inbred</a> was missing. It took me about three hours to track it down.</p>','Red Bull 2002, Saturday Morning'),('c0f3580cf14860428cb0a97e85125671f1a192b2',111,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-29',1349,NULL,800,600,0.400102726733056,'<p>Once we\'d drunk enough a night ride round the course with headtorches seemed like such a good idea. Remarkably we survived it without major injury.</p>','SSUK02 Nightride'),('540c716d3e91bdd1cb13148d08867c40d743d5db',113,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1339,NULL,896,600,0.503723361824854,'','SSUK02 Sara Randle'),('fdea7977287227e491cafa46542cb1b3cffc2abf',114,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-29',1339,NULL,896,600,0.382266560470562,'<p>That\'s my Inbred in the foreground and Chris Heath giving his Inbred a \'seeing to\'.</p>','SSUK02 Campsite'),('080a37c3527c01edecd8ff01bf4bd9d5c4de8703',115,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,800,600,0.947290021320402,'<p>And they\'re off... Good job that was a fast exposure otherwise we\'d all be really blurred.</p>','SSUK02, Start of Race'),('70997a00c85e1daec3bafaee3480f0b26a848dc8',121,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,768,506,0.0589275096589077,'<p>Gingernuts with his leg out \'just in case\'.</p>','SSUK02, Gingernuts'),('f9fa838fcac6e9b15c29eaa1897d41df97f50837',122,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,790,600,0.117446977926978,'<p>Wait a minute! Those bikes have gears...</p>\r\n\r\n<p>The keen guy is riding in a \'proper\' bike race that overlapped with the SS champs.</p>','SSUK02'),('ce3e625f015970fba7bf4a00a9c47fd657f6f39e',123,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,758,600,0.770764571728378,'<p>Nick at Thetford. Excellent shirt.</p>','SSUK02, Nick Wallis'),('1de297b0408439ca083460c71c1747ad3d2c7e95',125,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,800,600,0.323619103206958,'<p>Here\'s Kirsty Wallis ruling the Thetford singletrack. She ended up coming an excellent third, which puts my 68<sup>th</sup> place into perspective.</p>','SSUK02, Kirsty Rules the Trail'),('cc5b0591a8f78fa99a913bbf036a03fe18141f7b',126,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-06-30',1350,NULL,800,600,0.0691629728277725,'<p>What a proud bunch of athletes we are. I think this must be before the start because we\'re not lying around massaging our poor swollen knees.</p>','SSUK02, Riders at the Start'),('be70ade6f5c1a9bd6e163b717964e1e4f12cd948',127,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-07-03',1351,NULL,882,600,0.466365538879842,'<p>Hubba, hubba. Apa