've got the builders in.</p>','Five Amigos'),('a647a0bf5d5f3971653682c034d59ac555abd8e8',224,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-08',1339,NULL,800,600,0.176899221019927,'<p>Once a year Alnwick takes a week out to celebrate folk music from around the world. Some of it is good, some dire. On the whole I\'m rather glad it\'s over for another year. The novely wears off you see...</p>','Alnwick Music Festival'),('9a48dc7da2be471b31d3986bd0b67cdb72bb02a7',245,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-09',1356,NULL,800,600,0.754655684649517,'<p>This is Neil Storey\'s DOGS BOLX in an appropriate clinically pristine setting.</p>','Neil\'s BOLX'),('0026b430765b4034fee5616b0acc40504b66f84d',246,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-09',1356,NULL,800,600,0.855426897608503,'<p>You know how sometimes a bike just looks right?</p>','Neil\'s BOLX'),('b644acb0cbb7bcee494a170ed7761247797af130',247,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-09',1356,NULL,800,600,0.215791567576137,'<p>Close up of the rear brake, dropout and seatstay brace.</p>','Neil\'s BOLX'),('bea919060d97653f1ebe3da81f60f85decc568b4',248,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-29',1340,NULL,800,600,0.531096959567606,'<p>Close up of the custom rotor on Steve Makin\'s Bred Tin</p>','More Ears Than Gears'),('8cd6adc12f8d16faf6f823b641d7d779dbae15c8',250,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-08-25',1342,NULL,800,600,0.108009290484784,'<p>I\'m smiling because Chipps has just said \"you know you\'ve still got two minutes to go, don\'t you?\". The point being that if he\'d been right I\'d have had to do another ten mile lap. Grimacing rather than smiling then I suspect.</p>','Dusk til Dawn'),('d5c078e9b93d8c10fc0c3685eabb181f1686e13b',251,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-09-08',1339,NULL,896,600,0.71716597421463,'<p>Here we are on the way to Townley hall basking in the unseasonal sunshine.</p>','Singletrack Ride, September 2002'),('0e2f6f1ac9e77b7981c44e3184