NULL,NULL,NULL,'2002-10-05',1339,NULL,453,680,0.914647143339288,'<p>I can\'t imagine that tiger\'s tails are the best thing to make a bike from.</p>','Interbike Dirt Demo'),('bdabe748a1841d5fb6b58d912b7f1fc1698aa857',491,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,466,680,0.522848298936708,'<p>The demo\'s in a little town called Blue Diamond. It looks as if it normally actually has a population of around 20, but it still has a bike shop. I like those odds.</p>','Interbike Dirt Demo'),('467138a50661324b65fe6e479e91f9253f788891',492,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,800,535,0.855986330992533,'<p>There were lots of HPVs on show including this one on which the riders face away from each other. Ideal for tandem crews who have fallen out with each other.</p>','Interbike Dirt Demo'),('dfdceca0fda57ef9ba45569c05287036d7960b03',493,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,455,680,0.242069487873813,'<p>\"It\'s a particularly fine vintage sir...\"</p>','Interbike Dirt Demo'),('98960ff1fbe7a75f1b976c97212d731ecbad3b24',495,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,800,535,0.975596863946794,'<p>Lovely Kelly 29\" rigid, disk only singlespeed.</p>','Interbike Dirt Demo'),('2714e4b66e61aeb35d2a6e6b28a0e53c591b54da',497,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,455,680,0.144943632867424,'<p>New Fox fork with inertial lock out just like the Specialized Epic.</p>','Interbike Dirt Demo'),('55b223fe04a8bbf92b9588c53d274b563853ff3a',498,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,455,680,0.133015423019341,'<p>Another new fork from Fox. The disk only version is just this one with the brake bosses ground off, so you could just get busy with the angle grinder and do it yourself.</p>','Interbike Dirt Demo'),('0788e942f278a303f38a0ec32c73626b3a7379e2',499,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-05',1339,NULL,800,535,0.911787616957263,'<p>USE were showing 