ainted Manitou'),('9d81b2c6cfc234015ba5a8a5fc3c244249f757cc',540,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,800,588,0.608990915940879,'<p>Yet another lovely Ti EBB singlespeed.</p>','Independent Fabrications Ti EBB SS'),('bf0be864a18cb5d79f5d0b64d6bc7708e667a64f',541,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,723,680,0.775089222863183,'<p>This is a lot more exciting for single speed folk than it may look; it\'s a beautifully made properly sealed freewheel. It\'s going to be expensive but you\'re going to have to have one.</p>','White Industries Freewheel'),('fca7cfb93237052d1945b885277f7b47b886dd5f',542,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,800,535,0.597368569528776,'<p>Very pimpy, but a bit strange looking to my eye.</p>','Seven Duo'),('7aa072a4164749a2e4f176aa4da41a3497bf86d4',546,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,800,535,0.540357385664443,'<p>Personally I think this is one of the grossest things I\'ve ever seen, but it\'s clearly a labour of love for someone.</p>','Ew!'),('3ff754137b08ab0f208a6a451340c2a711fadd70',548,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,421,680,0.370238454601196,'<p>I bet it was hot in there.</p>','Female C3PO'),('e2bbfe3e24a0fc955ebbb7d56e0b8a9fe9c4bdff',549,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,465,680,0.147731499011329,'<p>From the brave attempt department this linear tracking from mech which actually shifted rather well albeit in pristine show conditions. It\'s not fully developed yet; they aim to have it on the market in six months. You\'ll need a special Gripshift style shifter and custom chainrings too.</p>','Linear tracking front mech'),('788d6dbdaae17f9f2f2f1b91353ef6decd6a2f3d',551,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2002-10-07',1339,NULL,389,680,0.085029569166263,'<p>This full suss recumbent kart was beautifully designed and built with spherical bearings on all the suspension joints, Roh